import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterModule, Router } from '@angular/router';
import { AuthService } from '../../services/auth.service';
import { User, Role } from '../../models';

@Component({
  selector: 'app-navbar',
  standalone: true,
  imports: [CommonModule, RouterModule],
  template: `
    <nav class="navbar navbar-expand-lg navbar-dark bg-primary">
      <div class="container">
        <a class="navbar-brand" [routerLink]="isLoggedIn ? '/dashboard' : '/login'">
          <i class="bi bi-chat-dots me-2"></i>
          3813ICT Chat App
        </a>

        <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
          <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse" id="navbarNav">
          <!-- Logged in navigation -->
          <ul *ngIf="isLoggedIn" class="navbar-nav me-auto">
            <li class="nav-item">
              <a class="nav-link" routerLink="/dashboard" routerLinkActive="active">
                <i class="bi bi-house me-1"></i>Dashboard
              </a>
            </li>
            <li *ngIf="canAccessAdmin" class="nav-item">
              <a class="nav-link" routerLink="/admin" routerLinkActive="active">
                <i class="bi bi-gear me-1"></i>Admin
              </a>
            </li>
          </ul>

          <!-- Logged out navigation -->
          <ul *ngIf="!isLoggedIn" class="navbar-nav ms-auto">
            <li class="nav-item">
              <a class="nav-link" routerLink="/login">
                <i class="bi bi-box-arrow-in-right me-1"></i>Login
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" routerLink="/register">
                <i class="bi bi-person-plus me-1"></i>Register
              </a>
            </li>
          </ul>

          <!-- User dropdown when logged in -->
          <ul *ngIf="isLoggedIn" class="navbar-nav">
            <li class="nav-item dropdown">
              <a class="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown">
                <i class="bi bi-person-circle me-1"></i>{{ currentUser?.username }}
                <span *ngIf="currentUser?.roles && currentUser.roles.length > 0" class="badge bg-light text-dark ms-1">
                  {{ getRoleDisplayName(currentUser.roles[0]) }}
                </span>
              </a>
              <ul class="dropdown-menu">
                <li><a class="dropdown-item" href="#"><i class="bi bi-person me-2"></i>Profile</a></li>
                <li><a class="dropdown-item" href="#"><i class="bi bi-gear me-2"></i>Settings</a></li>
                <li><hr class="dropdown-divider"></li>
                <li><a class="dropdown-item" href="#" (click)="logout()"><i class="bi bi-box-arrow-right me-2"></i>Logout</a></li>
              </ul>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  `,
  styles: []
})
export class NavbarComponent implements OnInit {
  isLoggedIn: boolean = false;
  currentUser: User | null = null;
  canAccessAdmin: boolean = false;

  constructor(
    private authService: AuthService,
    private router: Router
  ) {}

  ngOnInit(): void {
    this.updateAuthState();
  }

  private updateAuthState(): void {
    this.isLoggedIn = this.authService.isLoggedIn();
    this.currentUser = this.authService.getCurrentUser();
    this.canAccessAdmin = this.authService.isSuperAdmin() || this.authService.isGroupAdmin();
  }

  logout(): void {
    this.authService.logout();
    this.updateAuthState();
  }

  getRoleDisplayName(role: Role): string {
    switch (role) {
      case 'super': return 'Super Admin';
      case 'groupAdmin': return 'Group Admin';
      case 'user': return 'User';
      default: return role;
    }
  }
}
